import React, {Component} from 'react';
import data from '../data'

class Home extends Component{
    render() {
        return (
            <div className="d-flex flex-wrap container mt-5" style={{flexWrap: "wrap"}}>
                <div className="mb-5" style={{width: "33%"}}>
                    <div className="card" style={{width: "18rem"}}>
                        <img className="card-img-top" src="..." alt="Card image cap"/>
                        <div className="card-body">
                            <h5 className="card-title">
                                <a href="#" style={{textDecoration: "none"}}>Card title</a>
                            </h5>
                            <small className="card-text">Nike</small>
                            <br/>
                            <strong className="card-text">$60</strong>
                            <p>Go somewhere</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
